import React, {useEffect, useState} from "react";
import arr from "./all/1.mp4";
import "./App.css";
import ReactPlayer from "react-player";
const App = () => {

  const [click , setClick] = useState(false);
  useEffect(() => {
   console.log("hello")
  });
const now = () => {
  setClick(!click);
}
  return (
    <>
    <h1>hello</h1>
    <button onClick={now}>{click ? 'now' : 'after'}</button>
    </>
  );
};

export default App;
